package com.sajansthapit.mytodolist.models;import jakarta.persistence.MappedSuperclass;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import org.hibernate.annotations.CreationTimestamp;import org.hibernate.annotations.UpdateTimestamp;import java.time.LocalDateTime;@Data@MappedSuperclass@NoArgsConstructor@AllArgsConstructorpublic class BaseModel {    @CreationTimestamp    private LocalDateTime createdDateTime;    @UpdateTimestamp    private LocalDateTime updatedDateTime;    private boolean isActive;}